// import React from "react";

import { BrowserRouter as Router, Route, Link } from 'react-router-dom';

import Footer from './footer';
import Home from "./home/index";
import Login from "./signup/login";
import Register from "./signup/register";
import SideNav from './sidebar/sidenav.js';
import MainHeader from "./headers/mainheader";
import LoggedHeader from "./headers/loggedheader";
import CardView from "./mapview/cardview";
import Profile from "./userprofile/userprofile";
import Header from "./headers";
import AddAttractions from "./userprofile/addattractions";
import Blog from "./Details/Blog";
import Blog2 from "./Details/Blog2";
import UpdateAttractions from "./userprofile/updateattraction"




class App extends React.Component {
    render () {
        return (
            <Router>
                <div className = "App">

                    <Route exact path="/header" component={Header} />
                    <Route exact path="/" component={Home} />
                    <Route exact path="/login" component={Login} />
                   <Route exact path="/signup" component={Register} />
                   <Route exact path="/sidenav" component={SideNav} />
                   <Route exact path="/cardview" component={CardView} /> 
                   <Route exact path="/lh" component={LoggedHeader}/>
                   <Route exact path="/mh" component={MainHeader}/>                
                   <Route exact path="/profile" component={Profile} />
                   <Route exact path="/blog" component={Blog} />
                   <Route exact path="/blog2" component={Blog2} />
                   <Route exact path="/addattr" component={AddAttractions} />
                   <Route exact path="/editattr" component={UpdateAttractions} />




                <Footer/>               
             </div>

        </Router>
                        )
    }
}

export default App;
